insert  into `jy_game_notice`(`Id`,`Content`,`Title`,`Sort`,`Num`,`TitleSon`,`SendEmail`,`EmailContent`,`TitleContent`,`Channel`,`Btime`,`Remark`,`Status`,`DateTime`) values (3,'为了给玩家创造更加安全稳定的游戏环境，《诛仙3》将于2017年9月19日上午8:00-10:00对所有服务器进行停机维护。\r\n预计停机2小时，如遇特殊情况，开机时间将会顺延。若给您带来不便，敬请谅解。\r\n\r\n \r\n本次维护涉及更新，更新内容如下：\r\n \r\n【 签到奖励 】\r\n9月19日至10月16日期间，仙友们每日登陆游戏即可领取一份签到奖励，本次奖励的大奖依旧为玉虹雪华，仙友们可千万不要错过。\r\n \r\n \r\n【 体验性修改及优化 】\r\n1.载具包裹上限扩充至150格。\r\n2.修复了画影护符材料焱光灼的名称错误问题\r\n \r\n \r\n【 天帝宝库 】\r\n物品上架：\r\n1.商城“礼包—新品热卖”和“天材地宝—包裹仓库”目录分别上架“飞剑/坐骑包裹”，每次使用可扩充12格载具包裹，已达上限150格时使用\r\n无效；\r\n2.商城“礼包—新品热卖”和“时装—男子时装”目录分别上架男款“叹年少装”；\r\n3.商城“礼包—新品热卖”和“时装—女子时装”目录分别上架女款“叹年少装”。\r\n \r\n \r\n物品下架：\r\n1.商城“礼包—新品热卖”目录下架“小凡装大礼包（降临版）”、“碧瑶装大礼包（降临版）”，仍有需要的仙友可\r\n于\r\n“时装—主角时装”目录中购买；\r\n2.商城“礼包—新品热卖”目录下架“月德符”，仍有需要的仙友可于“法器—装备精炼”目录中\r\n购买；\r\n3.商城“礼包—新品热卖”目录下架“玄元天晶”、“紫府星衡”、“棠棣令”，仍有需\r\n要的仙友可于“法器—功能道具”目中中购买；\r\n4.商城“礼包—新品热卖”目录下架“神韵秘文石”，仍有需要的仙友可于“天材地宝—秘文晶石”，目录中购买；\r\n5.商城“礼包—新品热卖”目录下架“奇影画天卷”，仍有需要的仙友可于“时装—时装武器”\r\n目录中购买；\r\n6.商城“礼包—新品热卖”目录下架“同心礼盒”、“蝴蝶飞”、“夜萤火”、“花灯昼”，仍有需\r\n要的仙友可于“法器—师徒夫妻”目录中购买；\r\n7.商城“礼包—新品热卖”目录下架“揽月圣印”，仍有需要的仙友可于“仙宠—飞宝增益”目录中\r\n购买；\r\n8.商城“礼包—新品热卖”目录下架“揽月圣印礼包（绑定）”，仍有需要的仙友可于“礼包—宝券”目录中购买；\r\n9.商城“礼包—新品热卖”目录下架“天河秘琼”，仍有需要的仙友可于“天材地宝—包裹仓库”目录中购买。               \r\n\r\n                                                                                                                      \r\n                                                                                                                                                                                2017年9月19日','2017年9月',1,0,'2017年9月',0,'','',11,'2017-09-30 19:56:32','',2,'2017-09-15 14:15:19'),(4,'321312\r\n发生大恢复健康\r\n\r\n复合大师科技\r\n福建省断开\r\n\r\n福建省断开了                                            发送动环监控发圣诞节快乐\r\n\r\n\r\n福建省打开了\r\n俯拾地芥阿卡丽','2017-09-',1,0,'312321',0,'','',12,'2020-09-25 19:56:32','eqweqw',2,'2017-09-15 15:01:47'),(5,'32131232\r\n                 32131232\r\n\r\n\r\n32131232\r\n             32131232\r\n\r\n                                      32131232                       32131232                    32131232           32131232','312321',1,0,'321312',0,'','',11,'2017-09-18 19:56:32','3123213',2,'2017-09-18 17:47:42'),(6,'大数据侃大山                 加快了打算尽快了                      就发生大方块了                 附近开了\r\n                    发发圣诞节快乐                 发圣诞节快乐\r\n     \r\n\r\n\r\n\r\n\r\n                              附件的索拉卡                 分等级发了                          接口法律手段\r\n\r\n\r\n\r\n                                                                            fksd                    kfsd','321321',1,0,'321321',0,'','',11,'2017-09-28 19:56:32','312312',2,'2017-09-18 17:47:48'),(7,'321312312','3213123',1,0,'312312',0,'','',11,'2017-11-30 19:56:32','321312',2,'2017-09-18 17:47:54'),(8,'321312312','321321',1,0,'32132',0,'','',12,'2017-09-18 19:56:32','312312321',2,'2017-09-18 17:48:00'),(9,'312312321321','3213232',1,0,'',0,'','',11,'2017-09-18 19:56:32','321321312321',2,'2017-09-18 17:48:07'),(10,'312312321321','32132321',1,0,'',0,'','',11,'2017-09-18 19:56:32','312312321321',2,'2017-09-18 17:48:15'),(11,'32132321312','321321',1,0,'3213213',0,'','',11,'2017-09-18 19:56:32','312312321',2,'2017-09-18 17:48:22'),(12,'321312312321','321312',1,0,'321312',1,'','',0,'2017-09-18 19:56:32','321321321',2,'2017-09-18 17:48:30'),(13,'321321','321312',1,0,'',0,'','',11,'2017-09-28 19:56:32','321312',2,'2017-09-18 18:05:12'),(14,'亲爱的玩家：\r\n        街机在线捕鱼全新发布，超级福利来袭，你捕鱼，我送礼！\r\n        国庆七天乐，充值翻倍赠送，鱼池海量渔券，在线奖励免费领取，话费京东卡兑换到你手软，还等什么快来捕鱼吧！\r\n                                                                      2017年9月29日','全服停机更新维护',2,0,'全服停机',2,'555555','666666',11,'2017-11-10 19:56:32','',2,'2017-09-18 19:47:56');

/*Table structure for table `jy_game_version` */

DROP TABLE IF EXISTS `jy_game_version`;

CREATE TABLE `jy_game_version` (
  `Version` varchar(20) NOT NULL COMMENT '版本号',
  `DateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `Remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`Version`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

