  `AddUpEndTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '计费结束时间',
  `DateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '领取时间',
  PRIMARY KEY (`Id`),
  KEY `playerid` (`playerid`,`AddUpStartTime`,`AddUpEndTime`)
